import React from 'react';
import Pagination from '@mui/material/Pagination';
import Stack from '@mui/material/Stack';

const Paginate = (filter, totalTodos, todosPerPage) => {
    return (
        <Stack spacing={2}>
            <div className="inSelect">
                <Pagination count={10} showFirstButton showLastButton className="select" />
                <Pagination count={10} hidePrevButton hideNextButton className="select" />
            </div>
        </Stack>
    )
}

export default Paginate;

